import React from "react";

const ListGroup = props => {
  const { genres, onGenreChange } = props;
  return (
    <div>
      <ul className="list-group">
        {genres.map(g => (
          <li
            key={g._id}
            onClick={() => onGenreChange(g)}
            className="list-group-item">
            {g.name}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ListGroup;
